import {useAuth} from "./hooks/useAuth";
import {BrowserRouter, Navigate, Route, Routes} from "react-router-dom";
import {ReactComponent as LogoIcon} from "./components/logo.svg";
import {ReactComponent as HeroIllustration} from "./components/hero.svg";

function Logo() {
    return <LogoIcon />;
}

function LoginPage() {
  return <div className="flex w-screen h-screen overflow-hidden p-4">
      <div className="flex w-full flex-col h-full">
          <Logo />
      </div>
      <div className="w-full h-full bg-purple-800 rounded-xl flex flex-col justify-around">
          <HeroIllustration className="w-96" />
          <h1 className="text-2xl font-bold text-white text-center">Sign in to DineEase</h1>
      </div>
  </div>;
}

export function AppRouter() {
    const {isLoggedIn} = useAuth()

    if (isLoggedIn) {
        // Private routes
        return <BrowserRouter>
            <Routes>
                <Route path="search" element={<h1>search</h1>}/>
            </Routes>
        </BrowserRouter>
    }

    // Public routes
    return <BrowserRouter>
        <Routes>
            <Route path="login" element={<LoginPage/>}/>
            <Route path="register" element={<h1>register</h1>}/>
            <Route path="*" element={<Navigate to="login"/>}/>
            <Route path="/" element={<Navigate to="login"/>}/>
        </Routes>
    </BrowserRouter>
}
